        { name: "Catagory"  },
        { name: "Catagory"  },
        { name: "Catagory"  },
        { name: "Catagory"  },
    ]);

    return (
        <div>
            <div className="productgroup-container">
                <div className="title">
                    <p className='group-name'>Hot deals <img src={EmojiFire} width='10px' /></p>
                    <div className='thumbnail-products'>
                        <ThumbnailProduct></ThumbnailProduct>
                    </div>
                </div>
                    
            </div>
        </div>
    )
};

export default ProductGroup;
